import React, { Component } from 'react';

class MenuComponent extends Component {
    constructor(props) {
        super(props);

        this.redirectGroups = this.redirectGroups.bind(this);
        this.redirectJournal = this.redirectJournal.bind(this);
        this.redirectStudents = this.redirectStudents.bind(this);
    }


    redirectStudents(){
        this.props.history.push("/students");
    }

    redirectGroups(){
        this.props.history.push("/groups");
    }

    redirectJournal(){
        this.props.history.push("/journal");
    }

    render() {
        return (
            <div>
               <div className="my-5 px-4 py-3" id="menuContent">
                   <div className="mb-3"><button id="menuButton" onClick={this.redirectJournal()}>Список журналов</button></div>
                   <div className="mb-3"><button id="menuButton" onClick={this.redirectStudents()}>Список студентов</button></div>
                   <div className="mb-3"><button id="menuButton" onClick={this.redirectGroups()}>Список групп</button></div>
               </div>
            </div>
        );
    }
}


export default MenuComponent;
